import React, { Component } from 'react';
import './style/App.css';


import { BrowserRouter, Link, Route, Switch } from 'react-router-dom';

const Home = () => (
  <h1>
    Hello guys! Let's deal with 404?
  </h1>
);

const About = () => (
  <h1>
    About this example....
  </h1>
);

const Page404 = ({ location }) => (
  <div>
    <h2>404 <code>{location.pathname}</code></h2>
  </div>
);

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          {/* <img src={logo} className="App-logo" alt="logo" /> */}
          <h1 className="App-title">React Router Example</h1>
        </header>
        <BrowserRouter>
          <div>
          <nav className='nav_bar'>
        <ul className='header'>
          <li >
            <Link className='header_link' to="/">Home</Link>
          </li>
          <li>
            <Link className='header_link' to="/about">About</Link>
          </li>
          <li>
            <Link className='header_link' to="/blog">Blog</Link>
          </li>
          <li>
            <Link className='header_link' to="/more">More</Link>
          </li>
        </ul>
      </nav>

            <Switch>
              <Route path="/" exact component={Home}/>
              <Route path="/about" component={About}/>
              <Route component={Page404} />
            </Switch>
          </div>
        </BrowserRouter>
      </div>
    );
  }
}

export default App;
